import { useEffect, useState } from "react";
import { connect } from "react-redux";
import axios from "axios";
import getItem from "./Redux/action/itemAction";
import { getData } from "./Redux/action/action";

function Items(props) {
  const [num, Snum] = useState([]);
  const arr = ({} = props.statvalue);

  const arrayOfObjects = [
    { coffee: "Americano", size: "Medium" },
    { coffee: "Espresso", size: "Single" },
  ];

  useEffect(() => {
    props.getData();
  }, []);

  return (
    <>
      <h2>All Items</h2>
      {arr.map((res) => {
        console.log(res.item_name);
      })}
      {arrayOfObjects.map(({ coffee, size }) => (
        <p key={coffee}>
          Coffee type {coffee} in a {size} size.
        </p>
      ))}

      <button onClick={props.incr}>increment</button>
      <button onClick={props.decr}>decrement</button>
      {/* <button onClick={reset}>reset</button> */}
    </>
  );
}

const mapStateToProps = (state) => ({
  statvalue: state,
});
export default connect(mapStateToProps, { getData })(Items);
